import './App.css';
import MuiAutosuggest from "./Mui-autosuggest";
const movies = [
    {title: 'Mean Girls'},
    {title: 'Hackers'},
    {title: 'The Grey'},
    {title: 'Sunshine'},
      {title: 'Ex Machina'},
      ];

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          {movies}
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
